    <script>
      setTimeout(refresh, 15000);

      function refresh() {
        location.reload(true);
      }

      let d = new Date();
      let m = d.getMinutes();
      // let m = 41;
      console.log(m);

      const morn = document.querySelectorAll("#morn");
      const noon = document.querySelectorAll("#noon");
      const night = document.querySelectorAll("#night");
      
      console.log(morn);
      console.log(noon);
      console.log(night);

      if (m <= 20) {
        for (let i = 0; i < morn.length; i++) {
          morn[i].classList.remove("noViz");
          morn[i].classList.add("viz");
        }
      } else if (m > 20 && m <= 40) {
        for (let j = 0; j < noon.length; j++) {
          noon[j].classList.remove("noViz");
          noon[j].classList.add("viz");
        }
      } else {
        for (let k = 0; k < night.length; k++) {
          night[k].classList.remove("noViz");
          night[k].classList.add("viz");
        }
      }
      
    </script>
